import React from 'react';
import styled from 'styled-components';
import TodoItem from './TodoItem';

const TodoListBlock = styled.div`
  flex: 1;
  padding: 20px 32px;
  padding-bottom: 48px;
  overflow-y: auto;
`;


function TodoList() {
    return (
        <TodoListBlock>
            <TodoItem text="프로젝트 생성" done={true} />
            <TodoItem text="기능 구현하기" done={true} />
            <TodoItem text="개념노트 정리" done={false} />
            <TodoItem text="알고리즘 풀이" done={false} />
        </TodoListBlock>
    );
}

export default TodoList;
